import React from "react";
import styles from './Sidebar.module.css'
import Wrap from "../Wrap/Wrap";

const Sidebar = () => {
    return (
        <Wrap className = {styles.sidebar}>

            <div> 
            <img src="/tablogo.jpg" alt="Описание изображения" />            </div>

        </Wrap>
    )
}

export default Sidebar
